import './App.css';
import { TodoList } from '../TodoList/TodoList';
import { AddTodo } from '../AddTodo/AddTodo';
import React from 'react';

const todo = {
  description : 'todo'
}

class App extends React.Component {

  render() {

    return (
      <div className="App">

        <div>
          <AddTodo />
        </div>
        <div>
          <TodoList todoList={todoList} />
        </div>

      </div>
    );

  }
}

export default App;
